import React, { useState } from 'react';
import API, { setAuth } from '../services/api';
import { useNavigate } from 'react-router-dom';

export default function ReportForm(){
  const [form,setForm] = useState({ facultyName:'', className:'', weekOfReporting:'', dateOfLecture:'', courseName:'', courseCode:'', lecturerName:'', actualStudentsPresent:0, totalRegisteredStudents:0, venue:'', scheduledTime:'', topicTaught:'', learningOutcomes:'', recommendations:''});
  const nav = useNavigate();

  React.useEffect(()=>{ const t = localStorage.getItem('token'); if(t) setAuth(t); },[]);

  async function submit(e){
    e.preventDefault();
    try{
      await API.post('/reports', form);
      alert('Report submitted');
      nav('/reports');
    }catch(err){ alert(err.response?.data?.error || err.message); }
  }

  function set(k,v){ setForm(prev=>({...prev,[k]:v})); }

  return (
    <div className="col-md-8 offset-md-2">
      <h3>Create Report</h3>
      <form onSubmit={submit}>
        <div className="row">
          <div className="mb-2 col-md-6"><label>Faculty Name</label><input className="form-control" value={form.facultyName} onChange={e=>set('facultyName', e.target.value)} /></div>
          <div className="mb-2 col-md-6"><label>Class Name</label><input className="form-control" value={form.className} onChange={e=>set('className', e.target.value)} /></div>
          <div className="mb-2 col-md-4"><label>Week</label><input className="form-control" value={form.weekOfReporting} onChange={e=>set('weekOfReporting', e.target.value)} /></div>
          <div className="mb-2 col-md-4"><label>Date</label><input type="date" className="form-control" value={form.dateOfLecture} onChange={e=>set('dateOfLecture', e.target.value)} /></div>
          <div className="mb-2 col-md-4"><label>Course Name</label><input className="form-control" value={form.courseName} onChange={e=>set('courseName', e.target.value)} /></div>
          <div className="mb-2 col-md-4"><label>Course Code</label><input className="form-control" value={form.courseCode} onChange={e=>set('courseCode', e.target.value)} /></div>
          <div className="mb-2 col-md-4"><label>Lecturer Name</label><input className="form-control" value={form.lecturerName} onChange={e=>set('lecturerName', e.target.value)} /></div>
          <div className="mb-2 col-md-4"><label>Actual Present</label><input type="number" className="form-control" value={form.actualStudentsPresent} onChange={e=>set('actualStudentsPresent', e.target.value)} /></div>
          <div className="mb-2 col-md-4"><label>Total Registered</label><input type="number" className="form-control" value={form.totalRegisteredStudents} onChange={e=>set('totalRegisteredStudents', e.target.value)} /></div>
          <div className="mb-2 col-md-6"><label>Venue</label><input className="form-control" value={form.venue} onChange={e=>set('venue', e.target.value)} /></div>
          <div className="mb-2 col-md-6"><label>Scheduled Time</label><input className="form-control" value={form.scheduledTime} onChange={e=>set('scheduledTime', e.target.value)} /></div>
          <div className="mb-2 col-md-12"><label>Topic Taught</label><textarea className="form-control" value={form.topicTaught} onChange={e=>set('topicTaught', e.target.value)} /></div>
          <div className="mb-2 col-md-12"><label>Learning Outcomes</label><textarea className="form-control" value={form.learningOutcomes} onChange={e=>set('learningOutcomes', e.target.value)} /></div>
          <div className="mb-2 col-md-12"><label>Recommendations</label><textarea className="form-control" value={form.recommendations} onChange={e=>set('recommendations', e.target.value)} /></div>
        </div>
        <button className="btn btn-success">Submit</button>
      </form>
    </div>
  );
}
